import BackIcon from '../../assets/images/btn_back.svg';
import React from "react";

const BackButton = () => {
    const onClickHandler = (e : React.MouseEvent<HTMLElement>) => {
        alert("뒤로가기!");
    }
    return (
        <button className=''>
            <img src={BackIcon} alt={'backIcon'}  onClick={onClickHandler} />
        </button>
    )
}
export default BackButton;
